om nest.'),(96,89,'2007-06-21',-1,-1,'Nestlings chirping. Can\'t see how many.'),(97,89,'2007-07-07',-1,-1,'Male HOSP seen visiting the nest. No sound from nest.'),(98,90,'2007-06-12',-1,-1,'Parent sitting on nest.'),(99,90,'2007-06-18',-1,-1,'Parent still sitting on nest. Can\'t see how many eggs.'),(100,90,'2007-06-28',-1,-1,'Parent still sitting on nest. No sign of young.'),(101,90,'2007-01-01',-1,1,'Parent on nest, one nestling can be seen, there may be others.'),(102,87,'2008-04-29',-1,-1,'Noon - Cool windy day following a day of rain. Bird sitting on nest. When the leaves come out completely the nest will be very hard to observe.'),(103,87,'2008-04-23',-1,-1,'Noon - saw pair roosting low in trees. Within 20 yards of nest tree.'),(104,87,'2008-04-30',-1,-1,'AM - 7:00 cold about 3 degrees C. Bird sitting on nest. Can only see tail. Mate came up from west through underbrush and landed on edge of nest. Stayed a few seconds and moved through to roost tree about 25 yards east. Turned to set up camera. 2-3 minutes'),(105,87,'2008-05-01',-1,-1,'12:15 PM, mixed sun and cloud, cool 8c. Bird on nest, tail visible over edge. 20 minutes latter mate flew in low east to west to hemlock stand. No calls. Could not see if carrying any thing. 60 seconds latter flew to nest. Cannot see clearly but some jock'),(106,87,'2008-05-05',-1,-1,'Noon; warm and sunny. One bird at plucking tree with prey. Other bird sitting on nest. Tail feathers showing over edge. Bird that was not on nest approached through trees from west and bird on nest immediately left over opposite side then swung back to he'),(107,87,'2007-05-07',-1,-1,'Noon, warm. Nest very quiet. Racoons sleeping in trees close to hawk nest. A baby and an adult in trees on either side of the nest. I believe I saw some movement in the nest but I am not 100% sure. The leaves are filling out and hiding the view of the nes'),(108,87,'2008-05-08',-1,-1,'Noon, cool, cloudy. No bird activity. Can\'t tell if bird sitting on nest. Baby racoon in pileated woodpecker hole in tree next to nest. Possible nest has been abandoned.'),(109,87,'2008-05-12',-1,-1,'Noon, warm, windy. Saw the tail over the edge of the nest. No other action. The baby racoon still spends the morning and afternoon in the pileated woodpecker hole.'),(110,87,'2008-05-17',-1,-1,'Sunny and partly cloudy, windy, 17C. 1:00 PM one bird seen hunting over Vincent Massey Park, Other adult on nest. Tail and part of rump visible. Leafy cover is reducing sight lines. Racoons not seen in holes or in trees sleeping.'),(113,92,'2008-05-12',-1,-1,'Appear to be building nest'),(114,93,'2008-04-22',-1,-1,'Building nest'),(115,94,'2008-04-20',-1,-1,'Cleaning and rebuilding nest'),(116,94,'2008-05-08',-1,-1,'babies have hatched - peeping sounds'),(117,95,'2008-05-07',-1,-1,'First noticed nest.  Goose is incubating eggs.'),(118,87,'2008-05-20',-1,-1,'Noon, partly cloudy, cool. Observered one bird in nest (tail over edge) and second in plucking tree. Quiet, no movements.'),(119,94,'2008-05-19',-1,-1,'Nest appeared to be abandoned. Few peeps from babies.'),(120,94,'2008-05-20',-1,6,'Checked nest. No sounds of babies.  Opened nest to find six dead babies.  All about same size with pin feathers in wings.  Appeared normal - may have died of exposure??  Cleaned out nest.'),(121,96,'2008-05-23',-1,-1,'Starting nest building'),(122,97,'2008-05-24',-1,-1,'New? pair of birds building nest.'),(123,87,'2008-05-26',-1,-1,'Noon, sunny windy, adult low on perch, 5 feet off ground, within 10 yards of nest tree. No camera!'),(124,87,'2008-05-29',-1,-1,'4:15 pm Sunny, windy, tail visible over edge of nest.'),(125,98,'2008-05-29',-1,1,'The parent raven was making many croaking sounds while perched on the metal guard railing as a nestling watched and waited.  Parent then fed the nestling one bite at a time.  Could only see one nestling (top of head and bill).'),(126,87,'2008-05-31',-1,-1,'12:30 sunny. Male arrived with prey to plucking tree. Called to female on nest. Femal