oute was recorded on the observer\'s personal Zoom H2.'),(353,86,201,1,1,2,10,50,'2016-07-01','04:48','07:15',13,17,'n/a'),(354,78,201,1,3,4,0,0,'2016-07-03','04:49','06:48',14,16,'n/a'),(355,11,204,1,2,3,0,0,'2016-06-21','04:44','07:30',18.9,18,'n/a'),(356,18,173,1,1,3,90,60,'2017-06-10','04:45','07:45',17,17,'After discussion with Adam Smith, Point 5 (Rockliffe Parkway) has become point 7.  This is because the parkway only opens toward 6:45 to 7:00 am.  '),(357,19,163,1,4,4,20,40,'2017-06-11','04:44','06:42',20,22,'Going to be a hot, steamy day.  But, not too bad this early in the morning.'),(358,17,173,1,1,1,20,60,'2017-07-06','04:51','07:49',22,21,'n/a'),(359,14,173,3,1,1,100,100,'2017-07-01','04:48','07:28',24,22,'Varying amounts of rain fell during this transect.  I\'ve noted when the rain occurred in the comments for individual points.'),(362,12,201,2,1,1,30,100,'2017-07-01','04:48','06:28',19,19,'n/a'),(363,69,201,1,1,5,50,20,'2017-07-02','04:49','07:29',16,17,'n/a'),(364,21,201,1,5,5,100,10,'2017-07-07','04:52','06:58',19,20,'n/a'),(365,133,206,1,2,2,0,0,'2017-06-25','04:45','06:54',11.9,17.4,'Point count done with audio recorder'),(366,14,173,1,4,4,100,10,'2018-06-02','04:45','07:10',15,15,'n/a'),(367,40,205,1,3,2,40,60,'2017-06-09','04:45','06:55',17,15,'Sorry it took me so long to get this entered!'),(368,18,173,1,1,1,50,50,'2018-07-01','04:50','08:15',25,27,'I had to re-order the points somewhat, since Rockliffe Park (original point 5) was not open by 7:05 (official opening is at 7:00 am).  To keep to roughtly the same timing, I completed the next two point counts, then doubled back to Rockliffe Park and finished with that point.'),(369,13,215,1,2,2,0,0,'2018-06-25','04:45','06:31',12,12,'all points done with recorder.'),(370,17,173,1,1,1,0,10,'2018-07-02','04:50','07:45',27,27,'The land cover/land use around point 5 has changed significantly, with a new road having been built (Hospital Link)'),(371,91,128,1,2,2,50,50,'2018-07-05','04:57','08:20',22,27,'Google maps are out of date. For example, Rothbourne Road now intersects Hazeldean Road near point #7 \r\nPoint #7 is far too noisy with heavy traffic; ~ 100 cars passing by in 10 minutes. Moving it on to Rothbourne might be quieter?'),(372,71,6,1,3,4,0,10,'2018-07-02','05:10','08:15',22,30,'On bike'),(373,57,6,1,1,2,0,0,'2018-06-26','04:50','07:30',7,17,'With Bob Cermak, who drove and recorded the observations'),(374,94,216,1,1,1,0,20,'2007-01-01','04:50','06:35',20,23,'site one and two were loud because of proximity to HWY 416'),(375,91,216,1,1,3,40,80,'2018-06-16','04:45','07:35',12,17,'points near HWY 417 were loud.'),(377,3,217,1,4,4,20,10,'2018-07-06','04:51','07:56',26,21,'With the prior approval of Adam Smith, I changed the order of the points for this route.  This was because points 2, 3 and 4 are all in a non-stopping zone on Regional Road 174, and it was impractical to walk in along the highway.  The plan was to do points 1, 6, 7, and 8 by car and foot, and then launch a canoe at Petrie Island and do 4, 5, 3 and 2 by canoe.\r\n\r\nI was only partially successful in this, as the day turned out to be extremely windy - too windy to make it to points 3 and 2 at all. So points 2 and 3 were omitted, and the remainder were surveyed in the following order: 1, 6, 7, 8, 4, and 5.  I will include the latitude and longitude of where I was for points 4 and 5, as they were done from the water, not from their original locations on the road.\r\n\r\nNot only was the wind a problem for the canoeing, it interfered in the species count as well.  Having checked out the route a week or so earlier, I know there were a lot more bird species on Petrie Island than I could actually hear over the tree noise on the day.  If I am permitted to do this route again next season, I will do it earlier in the count period, so I have the flexibility to pick a better day.  I understand that intention is to have the count done at roughly the same time each year, but in future Iâ€™d like to move that time closer to the beginning of June than the beginning of July.  Since, for one reason and another, I ended up doing the survey on the last available count day, I couldnâ€™t put it off until it was less windy. '),(379,124,217,1,1,1,0,-1,'2018-07-05','04:51','06:45',20,-1,'When I surveyed this route in July, it was called \"Route 124\", and Points 4 and 5 had no UTMs and no Point Circles on the OBC 124 route map.  I thought that meant Points 4 and 5 had been removed from the route for some historical reason.  Now that I come to enter the data, I see that the route has changed its name to \"Petrie Island and Mainland\", and Points 4 and 5 have been reinstated.  Unfortunately, I have no data for them.\r\n\r\nIn addition, the land on which Point 7 was located has been completely flooded away, so I got as close to it as I could on a point of land to the east.  I have noted in the comments for Point 7 the latitude and longitude of where I stood.\r\n\r\nI brought an audio recorder along.  There are two recordings for Point 2:  the first is a false start, as I accidentally powered off instead of hitting start on my timer.'),(381,18,173,2,5,2,100,100,'2019-05-28','04:50','07:55',8,8,'Light rain (not forecast) started at around 6:00 am and continue to the end of the route.  Given the cold spring and the relatively early date, some of the birds detected were likely still migrating (e.g., Swainson\'s thrushes, Tennessee warblers).'),(382,14,173,1,5,5,0,0,'2019-06-08','04:45','07:05',11,14,'n/a'),(383,14,173,1,5,5,0,0,'2019-06-08','04:45','07:05',11,14,'n/a');

