e area since at least 2 years. \r\n\r\nNoise from construction site partially obstructive.',2,'n/a'),(1637,168,203,'N','N','N','N','N','09:00','Some obstructive noise form nearly house construction work.\r\n',-1,'n/a'),(1638,378,204,'N','N','N','N','N','05:00','n/a',10,'60'),(1639,379,204,'N','N','N','N','N','05:20','Light background traffic noise from nearby Bank Street',-1,'n/a'),(1640,380,204,'N','N','N','N','N','05:35','After the count period, 9 Mallards and one Green Heron in stormwater pond some 50 metres away form PC spot.',6,'n/a'),(1641,381,204,'N','N','N','N','N','06:00','Light rain during the last 4 minutes',6,'n/a'),(1642,382,204,'N','N','N','N','N','06:40','PC done from in front 3445 Southgate.\r\n\r\nLight rain just before and after count period.',-1,'n/a'),(1643,383,204,'N','N','N','N','N','07:05','Light rain last 6 minutes.\r\n\r\nAirplane noise 1st 2minutes',4,'n/a'),(1644,384,204,'N','N','N','N','N','07:35','Excessive noise from Bank Street traffic, and one plane during 4-6 period.\r\n\r\nAfter the count : House Finch 1',11,'100'),(1645,385,204,'N','N','N','N','N','07:55','Moderate background noise form traffic on Bank Street',4,'n/a'),(1646,386,204,'N','N','N','N','N','08:10','n/a',8,'n/a'),(1647,147,205,'N','N','N','N','N','05:10','n/a',5,'n/a'),(1648,148,205,'N','N','N','N','N','05:30','Constant background noise from ventilation fan of nearby Chimo Hotel\r\n\r\nAfter the count 1 Song Sparrow',-1,'n/a'),(1649,149,205,'N','N','N','N','N','05:50','n/a',-1,'n/a'),(1650,150,205,'N','N','N','N','N','06:05','Light fog, getting ticker',3,'n/a'),(1651,151,205,'N','N','N','N','N','06:20','Fog getting ticker; I cannot see passed 100 metres or so.',-1,'n/a'),(1652,153,205,'N','N','N','N','N','06:40','Fog, but not too dense.',4,'n/a'),(1653,152,205,'N','N','N','N','N','06:55','This 2nd Point ID 6 is actually Point ID 7',8,'n/a'),(1654,154,205,'N','N','N','N','N','07:10','This Point ID 7 is actually Point ID 8.\r\n\r\nExcessive traffic noise, over 70 vehicule